(5, 1, 'Terms & Conditions', ' ', '<header class=\"entry-header\">\r\n<h1 class=\"entry-title\">Terms &amp; Conditions</h1>\r\n</header>\r\n<div class=\"entry-content\">\r\n<p><strong>Disclaimer</strong></p>\r\n<p>MASK is a website and mobile application covers all that is specialized in the world of beauty and health which is fully owned by Union East Company Limited.</p>\r\n<p>The website, mobile application and all the contents of the software of Mask are available for use under the full responsibility of the user.</p>\r\n<p>Your use of the Website and the Application means that you are aware that the information contained in the website, the application was added by third parties and not necessarily by East Union Limited.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Use your website and apply a mask</strong></p>\r\n<p>1- Your use of the services of East Union Company Limited, the website and the application is subject to all applicable laws and regulations in the Kingdom of Saudi Arabia.</p>\r\n<ol start=\"2\">\r\n<li>Do not use the Services for commercial purposes and your use for commercial purposes allows us to cancel all services performed for commercial purposes without warning.</li>\r\n</ol>\r\n<p>3 &ndash; You agree that not to offend others in any form, whether personal or programmatic.</p>\r\n<p>4- You agree that not to upload and use the content of the website, the application or any means of the Eastern Union Company Limited in any form except with the written consent of the company management.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Our responsibility</strong></p>\r\n<p>When there is damage while using the application as a result of or because of part of the application, our responsibility is limited to monetary compensation only for transactions performed on the application.</p>\r\n<p>East Union Limited is not responsible for any damages or losses in any way as a result of your access to the website, the application, your access to any other website, application through mask-app.com, Mask application, exposure to any form of electronic anti-piracy or any kind of viruses or loss of information.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Reservations and prices</strong></p>\r\n<p>MASK Website and Application is a tool to coordinate between service providers and customers. &nbsp;The prices in the application are added by service providers. Your booking for appointments does not necessarily mean approval of the appointment and the service provider or application management may ask you for additional information to complete or cancel the reservation.</p>\r\n<p>Beauty salons reservations (women&rsquo;s Salons), fashion designers and make-up artists service provided to women only and the management of the website and the application has the right to cancel or write off any registered account for booking specified to women only among the former service providers and take the necessary legal action to protect the rights.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Rights</strong></p>\r\n<p>East Union company Limited owns all intellectual property rights in the website and application, including database, trademark, all contents and tools of the website and application.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Information security and privacy</strong></p>\r\n<p>East Union Company Limited has taken and takes all measures and regulations to ensure that customer information is not exposed to theft or piracy. However, we do not guarantee that information is not compromised, and we do not take full responsibility unless there is a clear error on our part.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>East Union Company might use private personal information in the following cases:</strong></p>\r\n<p>1- The financial conditions related to cash transactions such as payment and balance to verify payment and others.</p>\r\n<ol start=\"2\">\r\n<li>For the purposes of statistical operations, customer relations and delivery of services to you, including marketing and promotional messages.</li>\r\n</ol>\r\n<p><strong>We may disclose your personal information in the following cases:</strong></p>\r\n<ol>\r\n<li>If we are asked to do so in accordance with applicable laws and regulations or based on a judicial order or similar to a governmental and executive, including the Ministry of the Interior or one of the concerned governmental authorities.</li>\r\n<li>In the case of necessity and at the discretion of the management of Union East Company Limited in respect to the protection of legal and intellectual rights and private property of registered members or third parties or to prevent personal affect.</li>\r\n<li>You are responsible for maintaining the confidentiality of your password, user name, etc.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Cookies</strong></p>\r\n<p>Cookies are small pieces of text information stored by your browser on your computer&rsquo;s hard drive. We use cookies to allow us to understand who sees pages and ads, to determine how often private pages are visited, to determine the most popular areas of the site and generally to monitor site usage. Most web browsers accept cookies automatically, and membership requirements can do so. We do not control the use of cookies by third parties. If you want to disable cookies, you can do so by resetting your browser settings. However, please note that by disabling cookies you may not be able to register or use all features of the site.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Service fees</strong></p>\r\n<p>East Union Company Limited has the right to charge fees for use, service or both, and you will be notified, and the user has the right to continue using the service or not.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Update terms and conditions</strong></p>\r\n<p>East Union Company Limited has the right to change the terms and conditions at any time as required by the public interest and you will be informed by means of the electronic communication data of our registered customers.</p>\r\n</d