(10, 1, 'Help Center', 'Help Center', '<div class=\"col-sm-12 pad-0 contactt-sec\">\r\n<div class=\"col-sm-6\">\r\n<div id=\"wpcf7-f352-o1\" class=\"wpcf7\" dir=\"ltr\" lang=\"en-US\" role=\"form\">\r\n<div class=\"screen-reader-response\">&nbsp;</div>\r\n<form class=\"wpcf7-form\" action=\"%action_url%\" method=\"post\" novalidate=\"novalidate\">%csrf_field%\r\n<div style=\"display: none;\"><input name=\"container_post\" value=\"0\" type=\"hidden\" /></div>\r\n<div class=\"form-group\"><label>Full Name</label>\r\n<p><span class=\"form-control-wrap fullname\"><input name=\"name\" value=\"\" type=\"text\" class=\"form-control \" placeholder=\"Enter Full Name\" /></span></p>\r\n</div>\r\n<div class=\"form-group\"><label>Email</label>\r\n<p><span class=\"form-control-wrap your-email\"><input name=\"email\" value=\"\" type=\"email\" class=\"form-control\" placeholder=\"Enter Email\" aria-required=\"true\" /></span></p>\r\n</div>\r\n<div class=\"form-group\"><label>How we can help you?</label>\r\n<p>&nbsp;</p>\r\n<div class=\"col-sm-12\"><span class=\"wpcf7-form-control-wrap your-message\"><textarea class=\"form-control textarea\" cols=\"40\" name=\"message\" rows=\"10\" placeholder=\"Enter Your Message\" aria-invalid=\"false\"></textarea></span></div>\r\n</div>\r\n<p><input value=\"Send\" type=\"submit\" class=\"form-control submit\" /></p>\r\n<div class=\"response-output display-none\">&nbsp;</div>\r\n</form></div>\r\n</div>\r\n<div class=\"col-sm-6\">\r\n<div class=\"figure-contact\"><img src=\"https://mask-app.com/wp-content/themes/mask-sallon/images/contact-us.jpg\" /></div>\r\n<h3>Our Physical Address</h3>\r\n<address>\r\n<p><span style=\"color: #ffffff;\">East Union Limited Company</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;P.O.Box&nbsp; 1324-3480</span></p>\r\n<p><span style=\"color: #ffffff;\">Al Shohadaa</span></p>\r\n<p><span style=\"color: #ffffff;\">KSA</span></p>\r\n</address></div>\r\n</div>', NULL, 'pages/December2018/BCHAPAstjIFGlLAoXSr6.jpg'